import React from "react";
import GenericBadge from "./GenericBadge";

export default (props) => ( 
    <GenericBadge 
        text = {props.text}
        bgColor = "hsl(230, 66%, 90%)"
        color = "hsl(230, 66%, 30%)"
    >
    </GenericBadge>
);
